import styles from "../components/Main.module.css";
export const Home = () => {

    return (
        <main>
            <div className={styles.woodBack}>
                <div className={styles.pizzaWrapper}>
                <h2>We are making real Italian pizza since 2024</h2>
                <h3>Ищете место, где вкус пиццы оставляет только приятные воспоминания? Мы готовим настоящую итальянскую пиццу: тонкое тесто, сочная начинка и только свежие ингредиенты. Попробуйте — это любовь с первого кусочка! </h3>
                    <div className={styles.rollingPizza}></div>
                </div>
            </div>

        </main>
    )
}
